import React from "react";
import NavBar from "../navbar/NavBar";
const array = [
	{
	  type: "Stays",
	  icon: "fa-bed",
	  active: true,
	},
	{
	  type: "Flights",
	  icon: "fa-plane",
	  active: false,
	},
	{
	  type: "Car rentals",
	  icon: "fa-car",
	  active: false,
	},
	{
	  type: "Attractions",
	  icon: "fa-bed",
	  active: false,
	},
	{
	  type: "Airport taxis",
	  icon: "fa-taxi",
	  active: false,
	},
  ];
const Home = () => {
	return (
		<>
		<NavBar/>
		<div >
			<h1>Home Page</h1>
		</div>
	</>
	);
};

export default Home;
